angular.module('managerApp').component('cuiModal', {
  template: "\n            <div class=\"oui-modal oui-modal_shadow\">\n                <ng-transclude></ng-transclude>\n            </div>\n        ",
  transclude: true,
  bindings: {
    onDismiss: '&'
  }
}).component('cuiModalHeader', {
  template: "\n            <div class=\"oui-modal__header\">\n                <button class=\"oui-icon oui-icon-close_thin oui-modal__close-button\"\n                    type=\"button\"\n                    aria-label=\"Exit\" data-ng-click=\"$ctrl.onDismiss()\"></button>\n            </div>\n        ",
  bindings: {
    onDismiss: '&'
  }
}).component('cuiModalBody', {
  template: "\n            <div class=\"oui-modal__body\" data-ng-class=\"{ 'oui-modal__body_no-icon': !$ctrl.icon }\">\n                <i class=\"oui-icon oui-icon-{{ $ctrl.icon }}_circle oui-icon_bicolor\"\n                    aria-hidden=\"true\"\n                    data-ng-if=\"$ctrl.icon\"></i>\n                <h2 class=\"oui-modal__title\" data-ng-bind=\"$ctrl.title\"></h2>\n                <div class=\"oui-modal__text\" data-ng-transclude></div>\n            </div>\n        ",
  transclude: true,
  bindings: {
    icon: '@',
    title: '<'
  }
}).component('cuiModalText', {
  template: "\n            <p class=\"oui-modal__text\" data-ng-if=\"$ctrl.text\" data-ng-bind-html=\"$ctrl.text\"></p>\n            <p class=\"oui-modal__text\" data-ng-if=\"!$ctrl.text\" data-ng-transclude></p>\n        ",
  transclude: true,
  bindings: {
    text: '<'
  }
}).component('cuiModalFooter', {
  template: "\n            <div class=\"oui-modal__footer\">\n                <ng-transclude></ng-transclude>\n            </div>\n        ",
  transclude: true
});
